INSERT INTO `contacto` VALUES (1,'Ricardo Díaz Álvarez','3121234273','ridial.cl13@haomail.com','Te quiero','Un chingo','2014-04-27 06:34:29',1),(2,'Ricardo Díaz Álvarez','3121234273','ridial.cl13@hotmail.com','te quiero ','un chingo','2014-04-27 06:57:19',1),(3,'Ricardo Díaz Virgen','3123964007','diazv281@gmail.com','nnnnn','mmmmm','2014-04-27 06:56:47',1),(4,'Patito','312 3964007','diazv281@gmail.com','Asesoría','Monthatlán','2016-05-24 06:26:44',1),(5,'Jesús','3121578255','diazv281@gmail.com','diazv281@gmail.com','Monthatlán','2017-11-17 16:36:02',1),(6,'MaxPie','3335786000','sandy_dum@hotmail.com','Recolección','Buen día una pregunta, ustedes recolectan también residuos punzo cortantes?','2018-03-02 03:58:32',1),(7,'Eduardo Santillán Gutiérrez','3121404652','eddy_sancol@yahoo.com.mx','SOPORTE U APOYO EN PROYECTOS AMBIENTALES','Hola buen día Ricardo Diaz\n\nSoy Eduardo Santillán Gutiérrez cuñado de Hector Ortiz Delgado. Ya en algún momento me pediste de favor que si te apoyaba en algún proyecto, sin embargo las circunstancias por mi anterior trabajo no me lo permitieron. \n\nPues bien el motivo de este mensaje es para ofrecer mis servicios especializados que pudieran servir de soporte o apoyo en tus proyectos ambientales. De momento me encuentro en Colima, donde permaneceré temporalmente, lo cual quiero aprovechar mi estancia aquí colaborando con proyectos ambientales de cualquier índole en los cuales necesites ayuda.\n\nCualquier duda o comentario, puedes contactarme por medio de este correo o bien a mi número de celular 312 140 46 52.\n\nATTE \n\nEduardo Santillán Gutiérrez','2018-03-02 04:02:41',1),(8,'Azucena Cárdenas','3123206184','anecuza84@hotmail.com','Recolección RPBI','Buenas Tardes estoy interesada en sus servicios pero me gustaría saber si hace recolección de Residuos Biológicos Infecciosos RPBI, en caso afirmativo me interesa una cotización es para un consultorio, gracias','2018-03-08 18:54:42',1),(9,'Dental Torres','3121694940','mtarelo66@gmail.com',